from functools import lru_cache

def find_knight_probability(N, x, y, K):
    dir = [(-1, -2), (-2, -1), (-2, 1), (-1, 2), (1, 2), (2, 1), (2, -1), (1, -2)]

    @lru_cache(None)
    def solve(x, y, t):
        if not (0 <= x < N and 0 <= y < N):
            return 0
        if t == 0:
            return 1
        ans = 0
        for (i, j) in dir:
            ans += solve(x + i, y + j, t - 1)
        return ans
    return solve(x, y, K) * 8 ** K

